INSERT INTO `markdowns` (`id`, `contentHTML`, `contentMarkdown`, `description`, `doctorId`, `specialtyId`, `clinicId`, `createdAt`, `updatedAt`) VALUES
(1, '<h2></h2>\n<h3><strong>Thạc sĩ, Bác sĩ Đoàn Thị Lan</strong></h3>\n<p>Bác sĩ tư vấn dinh dưỡng cho phụ nữ mang thai và trẻ em</p>\n<p>Nhiều năm kinh nghiệm trong lĩnh vực Tư vấn dinh dưỡng</p>\n<p><strong>Quá trình công tác</strong></p>\n<p>Hiện là Bác sĩ khám và điều trị, Bệnh viện Đa khoa Bảo Sơn</p>\n<p><strong>Quá trình đào tạo</strong></p>\n<p>Tốt nghiệp Bác sĩ Đa khoa, Đại học Y Hà Nội</p>\n<p>Chứng chỉ Dinh dưỡng lâm sàng và điều trị, Viện dinh dưỡng quốc gia</p>\n<p><strong>Khám và điều trị</strong></p>\n<p>Tư vấn dinh dưỡng cho phụ nữ mang thai, phụ nữ sau sinh</p>\n<p>Tư vấn dinh dưỡng cho trẻ từ 0 – 5 tuổi, giai đoạn sơ sinh, ăn dặm</p>\n<p>Tư vấn dinh dưỡng cho phụ nữ mắc đái tháo đường thai kỳ, tăng/sụt cân trong thời kỳ mang thai, thiếu vi chất…</p>\n', '\n## \n### **Thạc sĩ, Bác sĩ Đoàn Thị Lan**\n\n\n\nBác sĩ tư vấn dinh dưỡng cho phụ nữ mang thai và trẻ em\n\nNhiều năm kinh nghiệm trong lĩnh vực Tư vấn dinh dưỡng\n\n**Quá trình công tác**\n\nHiện là Bác sĩ khám và điều trị, Bệnh viện Đa khoa Bảo Sơn\n\n**Quá trình đào tạo**\n\nTốt nghiệp Bác sĩ Đa khoa, Đại học Y Hà Nội\n\nChứng chỉ Dinh dưỡng lâm sàng và điều trị, Viện dinh dưỡng quốc gia\n\n**Khám và điều trị**\n\nTư vấn dinh dưỡng cho phụ nữ mang thai, phụ nữ sau sinh\n\nTư vấn dinh dưỡng cho trẻ từ 0 – 5 tuổi, giai đoạn sơ sinh, ăn dặm\n\nTư vấn dinh dưỡng cho phụ nữ mắc đái tháo đường thai kỳ, tăng/sụt cân trong thời kỳ mang thai, thiếu vi chất…', 'Bác sĩ tư vấn dinh dưỡng cho phụ nữ mang thai và trẻ em\nNhiều năm kinh nghiệm trong lĩnh vực Tư vấn dinh dưỡng', 5, NULL, NULL, '2024-02-20 09:28:08', '2024-02-20 09:28:08'),
(2, '<h3>Tiến sĩ, Bác sĩ Nguyễn Thị Thanh Thủy</h3>\n<p>35 năm kinh nghiệm lĩnh vực Cơ xương khớp</p>\n<p>Hiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1</p>\n<p>Từng công tác tại các bệnh viện lớn: Bệnh viện An Bình, Bệnh viện Trưng Vương, Bệnh viện Nhân dân 115</p>\n<p>Bác sĩ nhận khám từ 15 tuổi lên</p>\n<p><strong>Khám và điều trị</strong></p>\n<p>Đau thần kinh tọa</p>\n<p>Thoát vị đĩa đệm</p>\n<p>Viêm khớp dạng thấp</p>\n<p>Viêm cột sống dính khớp</p>\n<p>Thoái hóa khớp, cột sống cổ, cột sống thắt lưng</p>\n<p>Viêm quanh khớp vai, điểm bám các gân</p>\n<p>Bệnh loãng xương</p>\n<p>Nội soi các khớp, yếu cơ</p>\n<p><strong>Quá trình công tác</strong></p>\n<p>Hiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1</p>\n<p>Bác sĩ, Giám đốc - Bệnh viện Quận 8 (2009 - 2018)</p>\n<p>Bác sĩ, Trưởng khoa - Bệnh viện Trưng Vương (1997 - 2009)</p>\n<p>Bác sĩ, Phó khoa - Bệnh viện Nhân dân 115 (1993 - 1997)</p>\n<p>Bác sĩ - Bệnh viện An Bình (1988 - 1993)</p>\n<p>Quá trình đào tạo</p>\n<p>Tốt nghiệp Tiến sĩ Y khoa Trường Đại học Y Dược TP. Hồ Chí Minh (2018)</p>\n<p>Tốt nghiệp Thạc sĩ Y học Trường Đại học Y Dược TP. Hồ Chí Minh (2002)</p>\n<p>Tu nghiệp về đánh giá và điều trị đau tại Centre d’Évaluation et de Traitement de la douleur, Hôpital Saint Antoine - Pháp (1993)</p>\n<p>Tốt nghiệp Bác sĩ Trường Đại học Y Dược TP. Hồ Chí Minh (1987)</p>\n<p>Sách và các công trình nghiên cứu, báo cáo khoa học\nChủ nhiệm các đề tài:</p>\n<p>“Pain incidence, assessment, and management in Vietnam: a cross-sectional study of 12,136 respondents”, là Cộng sự tham gia nghiên cứu, Đăng trên“Journal of Pain Research ” 2019; 12: 769 - 777; Published online 2019 Feb 25; doi: 10.2147/JPR.S184713</p>\n<p>“Tỷ lệ, cơ cấu, và một số yếu tố liên quan đến đau mạn tính ở người dân các quận nội thành TPHCM”, Năm 2013, Đăng trên Tạp chí “NỘI KHOA VIỆT NAM” tháng 6/2015</p>\n<p>“Cơ cấu, tỷ lệ và các yếu tố liên quan đến đau mạn tính tại TPHCM”, Năm 2014, Đăng trên Tạp chí “Y-Dược học quân sự” số 6 - 2014</p>\n<p>“Cơ cấu, tỷ lệ và các yếu tố liên quan đến đau mạn tính hệ vận động tại TPHCM”, Năm 2014, Đăng trên Tạp chí “Y học Việt Nam” tháng 7 – số 1/2014</p>\n<p>“Góp phần chứng minh hiệu quả và so sánh tác dụng của các thuốc Alendronate-Calcium-Vit D3 và Calcium-Vit D3 lên mật độ khoáng xương ở những bệnh nhân giảm mật độ khoáng xương”, Năm 2007</p>\n<p>“Khảo sát mật độ xương ở những người ≥ 30 tuổi đến khám tại khoa Điều Trị Đau, BVCCTV”, Năm 2004</p>\n<p>“So sánh hiệu quả giữa Amitriptyline và Di-Antalvic trong điều trị đau sau zona”, Năm 2001, Đăng trên Tạp chí “Y học thành phố Hồ Chí Minh” Tập 7* Số 2* 2003</p>\n<p>Viết sách:</p>\n<p>Bài ”Đau xơ cơ”, Sách”Bệnh học những bệnh cơ xương khớp thường gặp”, NXB Y học 2020\n“Đau mạn tính”, Đăng trên Tạp chí “Thời sự Y học” Tháng 01&amp;02/2008\nBài ”Fibromyalgie”, Sách”Bệnh học một số bệnh lý cơ xương khớp thường gặp”, NXB Y học 2006\nSách dịch “Đau &amp; nhân viên y tế”, NXB Mũi Cà Mau 2001\nThành viên các Hội khoa học, tổ chức chuyên môn\nTổng Thư ký Hội Đau TP. Hồ Chí Minh\nỦy viên Ban Chấp hành Hội Thấp khớp TP. Hồ Chí Minh\nỦy viên Ban Chấp hành Hội Loãng xương TP. Hồ Chí Minh</p>\n', '### Tiến sĩ, Bác sĩ Nguyễn Thị Thanh Thủy\n35 năm kinh nghiệm lĩnh vực Cơ xương khớp\n\nHiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1\n\nTừng công tác tại các bệnh viện lớn: Bệnh viện An Bình, Bệnh viện Trưng Vương, Bệnh viện Nhân dân 115\n\nBác sĩ nhận khám từ 15 tuổi lên\n\n**Khám và điều trị**\n\nĐau thần kinh tọa\n\nThoát vị đĩa đệm\n\nViêm khớp dạng thấp\n\nViêm cột sống dính khớp\n\nThoái hóa khớp, cột sống cổ, cột sống thắt lưng\n\nViêm quanh khớp vai, điểm bám các gân\n\nBệnh loãng xương\n\nNội soi các khớp, yếu cơ\n\n**Quá trình công tác**\n\nHiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1\n \nBác sĩ, Giám đốc - Bệnh viện Quận 8 (2009 - 2018)\n\nBác sĩ, Trưởng khoa - Bệnh viện Trưng Vương (1997 - 2009)\n\nBác sĩ, Phó khoa - Bệnh viện Nhân dân 115 (1993 - 1997)\n\nBác sĩ - Bệnh viện An Bình (1988 - 1993)\n\nQuá trình đào tạo\n\nTốt nghiệp Tiến sĩ Y khoa Trường Đại học Y Dược TP. Hồ Chí Minh (2018)\n\n\nTốt nghiệp Thạc sĩ Y học Trường Đại học Y Dược TP. Hồ Chí Minh (2002)\n\nTu nghiệp về đánh giá và điều trị đau tại Centre d’Évaluation et de Traitement de la douleur, Hôpital Saint Antoine - Pháp (1993)\n\n\nTốt nghiệp Bác sĩ Trường Đại học Y Dược TP. Hồ Chí Minh (1987)\n\nSách và các công trình nghiên cứu, báo cáo khoa học\nChủ nhiệm các đề tài:\n\n\n“Pain incidence, assessment, and management in Vietnam: a cross-sectional study of 12,136 respondents”, là Cộng sự tham gia nghiên cứu, Đăng trên“Journal of Pain Research ” 2019; 12: 769 - 777; Published online 2019 Feb 25; doi: 10.2147/JPR.S184713\n\n“Tỷ lệ, cơ cấu, và một số yếu tố liên quan đến đau mạn tính ở người dân các quận nội thành TPHCM”, Năm 2013, Đăng trên Tạp chí “NỘI KHOA VIỆT NAM” tháng 6/2015\n\n“Cơ cấu, tỷ lệ và các yếu tố liên quan đến đau mạn tính tại TPHCM”, Năm 2014, Đăng trên Tạp chí “Y-Dược học quân sự” số 6 - 2014\n\n“Cơ cấu, tỷ lệ và các yếu tố liên quan đến đau mạn tính hệ vận động tại TPHCM”, Năm 2014, Đăng trên Tạp chí “Y học Việt Nam” tháng 7 – số 1/2014\n\n“Góp phần chứng minh hiệu quả và so sánh tác dụng của các thuốc Alendronate-Calcium-Vit D3 và Calcium-Vit D3 lên mật độ khoáng xương ở những bệnh nhân giảm mật độ khoáng xương”, Năm 2007\n\n“Khảo sát mật độ xương ở những người ≥ 30 tuổi đến khám tại khoa Điều Trị Đau, BVCCTV”, Năm 2004\n\n“So sánh hiệu quả giữa Amitriptyline và Di-Antalvic trong điều trị đau sau zona”, Năm 2001, Đăng trên Tạp chí “Y học thành phố Hồ Chí Minh” Tập 7* Số 2* 2003\n\nViết sách:\n\nBài ”Đau xơ cơ”, Sách”Bệnh học những bệnh cơ xương khớp thường gặp”, NXB Y học 2020\n“Đau mạn tính”, Đăng trên Tạp chí “Thời sự Y học” Tháng 01&02/2008\nBài ”Fibromyalgie”, Sách”Bệnh học một số bệnh lý cơ xương khớp thường gặp”, NXB Y học 2006\nSách dịch “Đau & nhân viên y tế”, NXB Mũi Cà Mau 2001\nThành viên các Hội khoa học, tổ chức chuyên môn\nTổng Thư ký Hội Đau TP. Hồ Chí Minh\nỦy viên Ban Chấp hành Hội Thấp khớp TP. Hồ Chí Minh\nỦy viên Ban Chấp hành Hội Loãng xương TP. Hồ Chí Minh', '35 năm kinh nghiệm lĩnh vực Cơ xương khớp\nHiện là Giám đốc chuyên môn, Bác sĩ Nội Cơ Xương Khớp - Phòng khám Bệnh viện Đại học Y Dược 1\nTừng công tác tại các bệnh viện lớn: Bệnh viện An Bình, Bệnh viện Trưng Vương, Bệnh viện Nhân dân 115\nBác sĩ nhận khám từ 15 tuổi lên', 2, NULL, NULL, '2024-02-20 09:29:20', '2024-02-20 09:29:20');

