(7, , 'Tai Mũi Họng', '<p><strong>Bác sĩ Chuyên khoa Tai Mũi Họng</strong></p>\n<p><strong>Danh sách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:</strong></p>\n<ul>\n<li>Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội</li>\n<li>Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội</li>\n<li>Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...</li>\n<li>Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...</li>\n</ul>\n<p><strong>Các bệnh Tai Mũi Họng</strong></p>\n<ul>\n<li>Ù tai, đau tai, chảy máu tai</li>\n<li>Thủng màng nhĩ, điếc đột ngột</li>\n<li>Viêm tai giữa</li>\n<li>Amidan, V.A</li>\n<li>Viêm xoang</li>\n<li>Nghẹt mũi</li>\n<li>Hay bị chảy máu cam</li>\n<li>Đau cổ họng, khó nuốt</li>\n<li>Ho kéo dài</li>\n<li>Ngủ ngáy</li>\n<li>...</li>\n</ul>\n', '**Bác sĩ Chuyên khoa Tai Mũi Họng**\n\n**Danh sách các bác sĩ tim mạch uy tín đầu ngành tại Việt Nam:**\n* Các chuyên gia có quá trình đào tạo bài bản, kinh nghiệm công tác tại các bệnh viện lớn về chuyên ngành Tiêu hóa tại Hà Nội\n* Các giáo sư, phó giáo sư là giảng viên Đại học Y khoa Hà Nội\n* Các bác sĩ đã, đang công tác tại các bệnh viện hàng đầu như Bệnh viện Bạch Mai, Bệnh Viện Việt Đức, Bệnh Viện Nhi Trung ương, Bệnh viện Y học Cổ truyền Việt Nam...\n* Được nhà nước công nhận các danh hiệu Thầy thuốc nhân dân, thầy thuốc ưu tú, bác sĩ cao cấp,...\n\n**Các bệnh Tai Mũi Họng**\n\n* Ù tai, đau tai, chảy máu tai\n* Thủng màng nhĩ, điếc đột ngột\n* Viêm tai giữa\n* Amidan, V.A\n* Viêm xoang\n* Nghẹt mũi\n* Hay bị chảy máu cam\n* Đau cổ họng, khó nuốt\n* Ho kéo dài\n* Ngủ ngáy\n* ...', '2024-03-14 23:22:13', '2024-03-14 23:22:13');
